<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
</head>
<body>
<!-- img tag -->
    <label> <b>Image Tag:</b> </label><br>
    <img src="91.jpg" height="300px" width="300px" alt="Alternative text"><br>
    <br>

<!-- audio tag -->
    <label> <b>Audio Tag:</b> </label><br>
    <audio controls src="audio.mp3"></audio><br>
    <br>

<!-- video tag -->
    <label> <b>Video Tag:</b> </label><br>
    <video controls src="243647_small.mp4" width="400px" height="400px" autoplay loop></video><br>
    <br>

<!-- svg tag -->
    <svg width="300" height="200">
        <circle cx="150" cy="100" r="80" fill="black" />
        <line x1="0" y1="0" x2="300" y2="200" stroke="green" stroke-width="4" />
    </svg><br>
<br>

<!-- iframe tag -->
<label> <b>YouTube(iframe Tag):</b> </label><BR></BR>
    <iframe width="560" height="315" src="https://www.youtube.com/embed/1n92hJLkIxM?si=POOt_ljNADn2voZn" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" referrerpolicy="strict-origin-when-cross-origin" allowfullscreen></iframe><br>
    <br>
    <iframe width="560" height="315" src="https://www.youtube.com/embed/iODvv3b5CNs?si=vhM90iMBhq2Mrn8b" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" referrerpolicy="strict-origin-when-cross-origin" allowfullscreen></iframe><br>
    <br>

<!-- embed tag -->

    <embed src="GSSS_RESUME.pdf" type="application/pdf" height="400px" width="400px"><br>

<!-- object tag -->
